import React, { useEffect, useState } from 'react';
import { Outlet } from 'react-router';
import Container from 'react-bootstrap/Container'
import { Link, useNavigate } from "react-router-dom";
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import Button from 'react-bootstrap/Button';
import Spinner from 'react-bootstrap/Spinner';
import util from "../util.js";
import styled from 'styled-components';

const StyledButton = styled(Button)`
  background-color: #2c4b9c;
  color: white;
`;

function Pika() {
  const navigate = useNavigate();
  const [data, setData] = useState('/');
  const [signOutLoading, setSignOutLoading] = useState(false);

  useEffect(() => {
    util.requestGET('/causes_api/get_user').then(res => {
      if (res.status === 200) {
        res.json().then(body => {
          if ('volunteer' in body) {
            setData('/volhome');
          } else {
            setData('/orghome')
          }
        });
      }
    });
  });
  return (
    <>
      <div className="Navigation">
        <Container className="m-0 p-0" style={{width: 1500}}>
        <Navbar expand="md" variant="light">
            <Container>
            <Link to="/" className="navbar-brand" style={{color: "#2c4b9c"}}><h3>Team Pika</h3></Link>
            </Container>
        </Navbar>
        </Container>
        </div>
      <Outlet />
    </>
  );
};

export default Pika;
